import React from 'react';
import Header from './Header';
import Navigation from './Navigation';

const Portfolio = () => {
  const holdings = [
    {
      id: 1,
      symbol: 'AAPL',
      shares: 10,
      image: 'https://lh3.googleusercontent.com/aida-public/AB6AXuD_lo14tLOTjsQK7Bi2QU3FrbD1_x2cdCQruhhFpEvYv4DeEt-Zy_6RnweFsLtq3K3-7d3tUrDdTbED346IZckFwyt7_Ee6B371ozoZFH7S2Ty6bNvkAzv1OkRr8QOY7mSLDwRCUHCZRmxf7DSynCujdLXDW90LvKf4KX2_2qrZA8cBNkFsLwUNT58K58k0vcrpt5-R0I4AjQLLN_SqHRP_vD8-5PI2JbYyCN5ZKM6tRaDyIdocACYnkwk6-ASKug0TJRCFYs01mSbz',
      value: 1750.30,
      change: 5.20,
      changePercent: 0.30
    },
    {
      id: 2,
      symbol: 'MSFT',
      shares: 5,
      image: 'https://lh3.googleusercontent.com/aida-public/AB6AXuDiE48UdOjVsiXcahwp5yrJmTXFTHaLNiQE13nq2Db67lXjSpEg22vS85fhKcBX7W84w5bNZBoSuU7HFZWlvMYfLmZiy2cZaNsEXKOKhLuZYPzi0Soxj7Q32AU3Z5jnuLkG-3BCniC-nvdzvt12BklbmVxAXYzmhfchvAMI0GXxAwDC-YfIP5yMdS1vYiQMkATtf7b1qClQYKRRhcYkef2D_2IDaT2a3-oeuZHibiL4RKZIUZJvdbGcEMeIXeyZq0bPZ_u-LvAVJcBl',
      value: 2120.50,
      change: 12.70,
      changePercent: 0.60
    },
    {
      id: 3,
      symbol: 'TSLA',
      shares: 20,
      image: 'https://lh3.googleusercontent.com/aida-public/AB6AXuC__g1OGui-vcx5tvAqlK-2zFBCf0DIJu4mCdcrU7Wfg0qh-G7AQGQqpjdRT0atDmrjH3VdeMgBOJ3rfdyfqr99r7fln1fMOW3tlh7MhTSOVHhFd--dmGWkqT0heqNSdJPBQGwWS6Thxg3xy8HnOJ7_Vjkj16rx5oml03xd3UZcJ9ablWFgNQD-65EgUQvdeJAz-_AMRlMmepemyQKwM_JDTJ7j8iRRJ_sUJnFIK6uN7kpKNTeuGnbOCDLfSWooltnzYn6qVV6tJhiF',
      value: 3500.00,
      change: -8.45,
      changePercent: -0.24
    }
  ];

  const newsItems = [
    {
      id: 1,
      image: 'https://lh3.googleusercontent.com/aida-public/AB6AXuBUMA82t_iqVrUgGMNTw4JjG3Bs6n2HP0cF4WYl2kroruy9nuSO-cAeu9PrCWtpx3Jn5L1Ey3-yvDm7A_GOxBsvhgYjoWvomZa_3jR2DEiFSpoC7BrV4brjF76bWq9djrHf6yx9NQLDw-XR7yBIohwTalLV-lTFLDjCBrYMkyp0TKeI0Uzl0GIr95sJbXd6pDNe52uSsaY5s786l4szoZpvzYKFY5yLh9-Aa4m8XxGaus_FNXYTI9icF6RtucyibbRjL7lucgkmXOd3',
      category: 'Breaking News',
      title: 'New Product Launch Boosts Stock',
      description: 'AAPL shares jump 5% following the unveiling of the new Vision Pro headset.'
    },
    {
      id: 2,
      image: 'https://lh3.googleusercontent.com/aida-public/AB6AXuDPEl0bbUQTKK0gkZmMofUnEvYuHtJY14jHugqqEoREXsCfe1TBdRnupFs7jOeAbvoMjHHLQHMKVieN-hlGs44cLYh5shhzlJDpgoFPy1ezpPnaKxrh_HTg2fC_h6FmGmRoXrUGu691ngpjTI7DEbOBV1QPfJp1ngswQfTp36zTUKal6S9cJmHfiLoVj6g2WsmDnH52JLY0_eK7vTo4Yu6awlbyBfsdwto8coJWpVQhJh40XO8JUNsRAS1chWmSFCRNggpHz6N4k9CR',
      category: 'Market Update',
      title: 'Record Quarterly Earnings Announced',
      description: 'MSFT stock rises 3% after reporting strong cloud service growth.'
    }
  ];

  return (
    <div className="flex flex-col min-h-screen">
      <Header title="Portfolio" />
      <main className="flex-1 overflow-y-auto pb-24">
        <div className="p-4">
          <h2 className="text-xl font-bold text-black dark:text-white mb-4">Your Holdings</h2>
          <div className="space-y-3">
            {holdings.map((holding) => (
              <div key={holding.id} className="flex items-center gap-4 p-3 rounded-lg bg-white/5 dark:bg-white/5">
                <div
                  className="w-12 h-12 rounded-lg bg-cover bg-center"
                  style={{ backgroundImage: `url("${holding.image}")` }}
                ></div>
                <div className="flex-1">
                  <p className="font-bold text-black dark:text-white">{holding.symbol}</p>
                  <p className="text-sm text-black/60 dark:text-white/60">{holding.shares} shares</p>
                </div>
                <div className="text-right">
                  <p className="font-bold text-black dark:text-white">${holding.value.toLocaleString()}</p>
                  <p className={`text-sm ${holding.change >= 0 ? 'text-primary' : 'text-red-500'}`}>
                    {holding.change >= 0 ? '+' : ''}{holding.change.toFixed(2)} ({holding.changePercent.toFixed(2)}%)
                  </p>
                </div>
              </div>
            ))}
          </div>
        </div>
        <div className="px-4 mt-6">
          <h2 className="text-xl font-bold text-black dark:text-white mb-4">News Impact</h2>
          <div className="space-y-4">
            {newsItems.map((item) => (
              <div key={item.id} className="rounded-xl overflow-hidden bg-background-light dark:bg-background-dark shadow-md border border-white/10 dark:border-white/10">
                <div
                  className="h-32 bg-cover bg-center"
                  style={{ backgroundImage: `url("${item.image}")` }}
                ></div>
                <div className="p-4">
                  <p className="text-xs text-black/60 dark:text-white/60 mb-1">{item.category}</p>
                  <h3 className="font-bold text-black dark:text-white mb-2">{item.title}</h3>
                  <p className="text-sm text-black/80 dark:text-white/80">{item.description}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      </main>
      <Navigation />
    </div>
  );
};

export default Portfolio;
